import React from "react";
import { FaHeartbeat, FaBrain, FaBone } from "react-icons/fa";
import { MdTipsAndUpdates } from "react-icons/md";
import { useNavigate } from "react-router-dom";
import "../index.css";

const Dashboard = () => {
  const navigate = useNavigate();

  const exerciseCards = [
    {
      title: "Cardiac Rehab",
      icon: <FaHeartbeat size={24} className="text-red-600" />,
      label: "Heart Health",
      color: "bg-yellow-400",
      exercises: ["Step-Ups", "Chair Marching", "Leg Extensions"],
      link: "/exercise/cardiac",
    },
    {
      title: "Neuro Rehab",
      icon: <FaBrain size={24} className="text-purple-600" />,
      label: "Neurological Recovery",
      color: "bg-yellow-400",
      exercises: ["Balance Training", "Gait Training", "Coordination"],
      link: "/exercise/neuro",
    },
    {
      title: "Orthopedic Rehab",
      icon: <FaBone size={24} className="text-blue-700" />,
      label: "Bone & Joint Recovery",
      color: "bg-yellow-400",
      exercises: ["Chair Squats", "Leg Raise", "Shoulder Rolls"],
      link: "/exercise/ortho",
    },
    {
      title: "Physiotherapy Tips",
      icon: <MdTipsAndUpdates size={24} className="text-amber-500" />,
      label: "Guidance",
      color: "bg-yellow-400",
      exercises: ["Hydration", "Proper Form", "Rest"],
      link: "/exercise/physio",
    },
  ];

  return (
    <div className="min-h-screen bg-gray-100">
      <header className="bg-blue-800 text-white px-6 py-4 flex justify-between items-center shadow-md">
        <h1 className="text-2xl font-semibold">AI Rehab Dashboard</h1>
        <nav className="space-x-6">
          <a href="/home" className="hover:underline">Home</a>
          <a href="/profile" className="hover:underline">Profile</a>
          <a href="/logout" className="hover:underline">Logout</a>
        </nav>
      </header>

      <main className="p-6 grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
        {exerciseCards.map((card, index) => (
          <div
            key={index}
            className="bg-white rounded-xl shadow-md hover:shadow-xl p-5 transition-transform duration-300 transform hover:scale-105 flex flex-col justify-between"
          >
            <div className="flex items-center gap-3 mb-2">
              {card.icon}
              <h2 className="text-lg font-semibold text-gray-800">{card.title}</h2>
            </div>
            <span className={`inline-block text-xs font-semibold px-3 py-1 rounded-full ${card.color} text-white mb-3`}>
              {card.label}
            </span>
            <ul className="mb-4 list-disc list-inside text-sm text-gray-700">
              {card.exercises.map((ex, i) => (
                <li key={i}>{ex}</li>
              ))}
            </ul>
            <button
              className="mt-auto bg-blue-900 text-white px-4 py-2 rounded hover:bg-blue-700"
              onClick={() => navigate(card.link)}
            >
              Start
            </button>
          </div>
        ))}
      </main>
    </div>
  );
};

export default Dashboard;
